	];


	useEffect(() => {

		fetch(`http://localhost:3000/category`)
			.then(response => response.json())
	      	.then(data => {
	      		data.map(i => {
	      			console.log(i[0])
	      		})
	      	})
	      		// setCategories(data));

	},[])

	return (
		<div className='w-30'>
		  <Select
		    options={categories}
		  />
		</div>
	);
}

export default Search;
